INSERT INTO `wp_posts` VALUES (1,1,'2018-05-26 18:57:14','2018-05-26 16:57:14','Bienvenue sur WordPress. Ceci est votre premier article. Modifiez-le ou supprimez-le, puis lancez-vous !','Bonjour tout le monde !','','publish','open','open','','bonjour-tout-le-monde','','','2018-05-26 18:57:14','2018-05-26 16:57:14','',0,'http://localhost/wordpress/?p=1',0,'post','',1),(2,1,'2018-05-26 18:57:14','2018-05-26 16:57:14','Voici un exemple de page. Elle est différente d’un article de blog, en cela qu’elle restera à la même place, et s’affichera dans le menu de navigation de votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\n\n<blockquote>Bonjour ! Je suis un mécanicien qui aspire à devenir un acteur, et ceci est mon blog. J’habite à Bordeaux, j’ai un super chien qui s’appelle Russell, et j’aime la vodka-ananas (ainsi que perdre mon temps à regarder la pluie tomber).</blockquote>\n\n...ou bien quelque chose comme cela :\n\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis cette année. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\n\nÉtant donné que vous êtes un nouvel utilisateur ou une nouvelle utilisatrice de WordPress, vous devriez vous rendre sur votre <a href=\"http://localhost/wordpress/wp-admin/\">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !','Page d’exemple','','publish','closed','open','','page-d-exemple','','','2018-05-26 18:57:14','2018-05-26 16:57:14','',0,'http://localhost/wordpress/?page_id=2',0,'page','',0),(3,1,'2018-05-26 18:57:40','0000-00-00 00:00:00','','Brouillon auto','','auto-draft','open','open','','','','','2018-05-26 18:57:40','0000-00-00 00:00:00','',0,'http://localhost/wordpress/?p=3',0,'post','',0),(4,1,'2018-05-26 19:05:52','2018-05-26 17:05:52','','artist-logo@2x-free-img','','inherit','open','closed','','artist-logo2x-free-img','','','2018-05-26 19:05:52','2018-05-26 17:05:52','',0,'http://localhost/wordpress/wp-content/uploads/2018/05/artist-logo@2x-free-img.png',0,'attachment','image/png',0),(5,1,'2018-05-26 19:05:53','2018-05-26 17:05:53','p.ast-stock-detail/*Hide stock*/\n{\n    display: none;\n}\n\n\n/*Give box shadow to category and product thumbnails*/\n.product .wp-post-image,\n.woocommerce-product-gallery__image,\n.product-category img\n{\nbox-shadow:10px 10px 50px rgba(67, 67, 67,0.25) !important;\n}\n\n\n\n\n#gMap/*Give box shadow and grayscale to Google Map*/\n{\nfilter: grayscale(100%) brightness(101%) contrast(120%);\nbox-shadow:1.25rem 1.375rem 4.75rem 0rem rgba(0,0,0,0.22);\n}\n\n\n\n/*WooCommerce Page Heading style (Not for Desktop)*/\n.woocommerce-products-header h1\n{\n  font-size: 3em !important;	\n	line-height:1.4em;\n	margin-bottom:20px;\n	color: #000c30;\n}\n\n\n\n@media (min-width: 1201px)\n{\n.ast-separate-container .ast-woocommerce-container /*Change container padding for Desktop*/\n{\npadding: 4em 4em;\n}\n	\n.woocommerce-products-header h1\n/*WooCommerce Page Heading style\n(For Desktop)*/\n{\nfont-size: 4em !important;	\n	line-height:1.4em;\n	margin-bottom:20px;\n	color: #000c30;\n}\n\n}\n\n/*Float count on right*/\n.widget_product_categories .count\n{\n	float: right;\n}\n\n\n\n/*Button design style for Purchase button*/\n#primary-menu .button\n{\n	padding: 0 20px;\n	line-height:3em;\n}\n#primary-menu .button a\n{color: #fff;\n}','astra','','publish','closed','closed','','astra','','','2018-05-26 19:05:53','2018-05-26 17:05:53','',0,'http://localhost/wordpress/2018/05/26/astra/',0,'custom_css','',0),(6,1,'2018-05-26 19:05:53','2018-05-26 17:05:53','p.ast-stock-detail/*Hide stock*/\n{\n    display: none;\n}\n\n\n/*Give box s